import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Login from './Login';

function App() {
    const [message, setMessage] = useState('');

    useEffect(() => {
        // Pozivamo Spring Boot backend API koji se izvršava na localhost:8080
        axios.get('http://localhost:8080/')
            .then(response => {
                setMessage(response.data); // Postavi odgovor na message
            })
            .catch(error => console.error('Error:', error));
    }, []);

    return (
      <div className="App">
          <Login />
      </div>
  );
}

export default App;
